import React, { useState, useEffect } from 'react';
import {
    Box,
    Paper,
    Typography,
    Divider,
    CircularProgress,
    Alert,
    Grid
} from '@mui/material';
import { API_BASE_URL } from '../config';

function StageView({ stageId }) {
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [stageData, setStageData] = useState(null);

    useEffect(() => {
        const fetchStageData = async () => {
            if (!stageId) {
                setLoading(false);
                return;
            }

            try {
                setLoading(true);
                setError(null);
                
                const businessId = localStorage.getItem('businessId');
                if (!businessId) {
                    throw new Error('No business ID found in local storage');
                }

                const response = await fetch(`${API_BASE_URL}/stages/${stageId}?business_id=${businessId}`, {
                    method: 'GET',
                    headers: {
                        'Accept': 'application/json'
                    },
                    credentials: 'include'
                });

                if (!response.ok) {
                    const errorData = await response.json().catch(() => ({}));
                    throw new Error(errorData.error || `Failed to fetch stage data (${response.status})`);
                }

                const data = await response.json();
                console.log('Stage data:', data);
                setStageData(data);
            } catch (err) {
                console.error('Error fetching stage:', err);
                setError(err.message);
            } finally {
                setLoading(false);
            }
        };

        fetchStageData();
    }, [stageId]);

    if (loading) {
        return (
            <Box display="flex" justifyContent="center" p={3}>
                <CircularProgress />
            </Box>
        );
    }

    if (error) {
        return (
            <Alert severity="error" sx={{ mt: 2 }}>
                {error}
            </Alert>
        );
    }

    if (!stageData) {
        return (
            <Alert severity="info" sx={{ mt: 2 }}>
                No stage data available
            </Alert>
        );
    }

    return (
        <Paper sx={{ p: 3, mt: 2 }}>
            {/* Basic Information Section */}
            <Typography variant="h6" gutterBottom>
                Basic Information
            </Typography>
            <Divider sx={{ mb: 2 }} />
            
            <Grid container spacing={2}>
                <Grid item xs={12}>
                    <Typography variant="subtitle2" color="primary">Name</Typography>
                    <Typography>{stageData.stage_name}</Typography>
                </Grid>

                <Grid item xs={12}>
                    <Typography variant="subtitle2" color="primary">Description</Typography>
                    <Typography>{stageData.stage_description || 'No description'}</Typography>
                </Grid>

                <Grid item xs={12}>
                    <Typography variant="subtitle2" color="primary">Type</Typography>
                    <Typography>{stageData.stage_type}</Typography>
                </Grid>

                <Grid item xs={12} sm={6}>
                    <Typography variant="subtitle2" color="primary">Stage ID</Typography>
                    <Typography component="code">{stageData.stage_id}</Typography>
                </Grid>

                <Grid item xs={12} sm={6}>
                    <Typography variant="subtitle2" color="primary">Business ID</Typography>
                    <Typography component="code">{stageData.business_id}</Typography>
                </Grid>

                {stageData.agent_id && (
                    <Grid item xs={12} sm={6}>
                        <Typography variant="subtitle2" color="primary">Agent ID</Typography>
                        <Typography component="code">{stageData.agent_id}</Typography>
                    </Grid>
                )}
            </Grid>

            {/* Template Configuration Section */}
            <Typography variant="h6" sx={{ mt: 4, mb: 2 }}>
                Template Configuration
            </Typography>
            <Divider sx={{ mb: 2 }} />
            
            <Grid container spacing={2}>
                <Grid item xs={12}>
                    <Typography variant="subtitle2" color="primary">Stage Selection Template</Typography>
                    <Typography component="code" sx={{ display: 'block', my: 1, p: 1, bgcolor: 'grey.100', borderRadius: 1 }}>
                        ID: {stageData.stage_selection_template_id || 'Not configured'}
                    </Typography>
                    {stageData.stage_selection_config && (
                        <Box sx={{ ml: 2, mt: 1 }}>
                            <Typography variant="body2">Name: {stageData.stage_selection_config.template_name}</Typography>
                        </Box>
                    )}
                </Grid>

                <Grid item xs={12}>
                    <Typography variant="subtitle2" color="primary">Data Extraction Template</Typography>
                    <Typography component="code" sx={{ display: 'block', my: 1, p: 1, bgcolor: 'grey.100', borderRadius: 1 }}>
                        ID: {stageData.data_extraction_template_id || 'Not configured'}
                    </Typography>
                    {stageData.data_extraction_config && (
                        <Box sx={{ ml: 2, mt: 1 }}>
                            <Typography variant="body2">Name: {stageData.data_extraction_config.template_name}</Typography>
                        </Box>
                    )}
                </Grid>

                <Grid item xs={12}>
                    <Typography variant="subtitle2" color="primary">Response Generation Template</Typography>
                    <Typography component="code" sx={{ display: 'block', my: 1, p: 1, bgcolor: 'grey.100', borderRadius: 1 }}>
                        ID: {stageData.response_generation_template_id || 'Not configured'}
                    </Typography>
                    {stageData.response_generation_config && (
                        <Box sx={{ ml: 2, mt: 1 }}>
                            <Typography variant="body2">Name: {stageData.response_generation_config.template_name}</Typography>
                        </Box>
                    )}
                </Grid>
            </Grid>

            {/* Creation Date */}
            {stageData.created_at && (
                <Box mt={4}>
                    <Divider />
                    <Typography variant="caption" color="text.secondary" sx={{ mt: 2, display: 'block' }}>
                        Created: {new Date(stageData.created_at).toLocaleString()}
                    </Typography>
                </Box>
            )}
        </Paper>
    );
}

export default StageView;
